import { createStore, createEvent } from 'effector';
import { tabs } from '../data/tabs';

export const $tabs = createStore(tabs);

export const changeTab = createEvent();
export const $currentTab = createStore(tabs[0].id)
  .on(changeTab, (currenTab, tabToOpen) => tabToOpen);
